INSERT INTO `posts` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Прошел запуск обновленной нейросети MidJourney V5', '16 марта прошел запуск следующей версии известной нейросети Midjourney. Стало известно, что нейросеть получила наименование MidJourney V5 и уже открыта для испытания. Создатели нейросети сообщили, что MidJourney V5 обладает «гораздо более высоким качеством картинки, более разнообразными выходными данными, широким стилистическим диапазоном и поддерживает бесшовные текстуры».\r\n\r\nMidJourney V5 будет предлагать юзерам два изображения во время предварительной стадии, после чего требуется выбрать одно из них, определить понравившийся стиль и двигаться дальше. Создатели хорошо поработали над генерацией лица, глаз, пальцев и остальных конечностей, что было проблемой в остальных версиях нейросети.\r\n\r\nРанее pepelac.news писал, что Индия подготовила новые правила к мобильникам иностранного производства.', '2023-03-16 11:19:02', '2023-03-16 11:19:02'),
